sabled'=>'Browsercaching is uitgeschakeld','Enabling browser caching can improve performance by storing static assets in the browser for faster page loads.'=>'Het inschakelen van browser cachen kan de prestaties verbeteren door statische assets in de browser op te slaan voor snellere laden van de pagina.','Cloudflare enabled'=>'Cloudflare ingeschakeld','Cloudflare integration is enabled'=>'Cloudflare integratie is ingeschakeld','Cloudflare integration is disabled'=>'Cloudflare integratie is uitgeschakeld','Cloudflare integration can improve performance and security.'=>'Cloudflare integratie kan de prestaties en veiligheid verbeteren.','Concatenate CSS'=>'Concatenate CSS','CSS files are concatenated'=>'CSS-bestanden worden samengevoegd','CSS files are not concatenated'=>'CSS-bestanden worden niet samengevoegd','Concatenating CSS can improve performance by reducing the number of requests.'=>'CSS-opmaak kan de prestaties verbeteren door het aantal aanvragen te verminderen.','Concatenate JavaScript'=>'Samengevoegde JavaScript','JavaScript files are concatenated'=>'JavaScript-bestanden worden samengevoegd','JavaScript files are not concatenated'=>'JavaScript-bestanden worden niet samengevoegd','Concatenating JavaScript can improve performance by reducing the number of requests.'=>'Het opvangen van JavaScript kan de prestaties verbeteren door het aantal verzoeken te verminderen.','WP Cron Lock Timeout'=>'WP Cron Lock Timeout','Cron lock timeout is set to 60 seconds or less.'=>'Time-out voor Cron slot is ingesteld op 60 seconden of minder.','Cron lock timeout is set to a high number.'=>'Cron lock timeout is ingesteld op een hoog aantal.','Cron lock timeout affects how long a cron job can run for. Setting it to a lower number can improve performance.'=>'Timeout bij Cron-slot is van invloed op hoe lang een cron job kan werken. Het instellen op een lager getal kan de prestaties verbeteren.','Defer Non-Essential JavaScript'=>'Uitstellen van niet-Essentiële JavaScript','Non-essential JavaScript is deferred'=>'Niet-essentiële JavaScript is uitgesteld','Non-essential JavaScript is not deferred'=>'Niet-essentiële JavaScript is niet uitgesteld','JavaScript can be deferred to improve performance by loading it after the page has loaded.'=>'JavaScript kan worden uitgesteld om de prestaties te verbeteren door deze te laden nadat de pagina is geladen.','Empty Trash Days'=>'Leeg aantal dagen uit prullenbak','Trash is emptied every 30 days or less'=>'Prullenbak is elke 30 dagen leeg','Trash is emptied less frequently than every 30 days.'=>'Prullenbak wordt minder vaak leeg gemaakt dan elke 30 dagen.','Emptying the trash more frequently can reduce database bloat.'=>'Het vaker legen van de prullenbak kan de database bloat verminderen.','Lazy Loading'=>'Lui laden','Lazy loading is enabled'=>'Lazy laden is ingeschakeld','Lazy loading is disabled'=>'Lazy laden is uitgeschakeld','Lazy loading can improve performance by only loading images when they are in view.'=>'Lazy laden kan de prestaties verbeteren door alleen afbeeldingen te laden als ze in de weergave zijn.','Link Prefetching'=>'Prefetching van link','Link prefetching is enabled'=>'Link prefetching is ingeschakeld','Link prefetching is disabled'=>'Link prefetching is uitgeschakeld','Link prefetching can improve performance by loading pages immediately before they are requested.'=>'Link prefetching kan de prestaties verbeteren door pagina\'s direct te laden voordat ze worden opgevraagd.','Page Caching'=>'Pagina caching','Page caching is enabled'=>'Pagina caching is ingeschakeld','Page caching is disabled'=>'Pagina caching is uitgeschakeld','Page caching can improve performance by bypassing PHP and database queries for faster page loads.'=>'Pagina caching kan de prestaties verbeteren door PHP en database zoekopdrachten te omzeilen voor snellere pagina-lading.','Permalinks'=>'Permalinks','Permalinks are pretty'=>'Permalinks zijn mooi','Permalinks are not set up'=>'Permalinks zijn niet ingesteld','Sett