nded.'=>'Niet aanbevolen.','Cache static assets like images and the appearance of your site for 1 hour.'=>'Cache statische assets zoals afbeeldingen en het uiterlijk van je site gedurende 1 uur.','Assets Only'=>'Alleen content','Cache enabled for assets only.'=>'Cache alleen voor assets ingeschakeld.','Tuned for online stores and member sites that need to be fresh.'=>'Gemeld voor online winkels en lidsites die vers moeten zijn.','Cache static assets for 24 hours and web pages for 2 hours.'=>'Cache statische activa voor 24 uur en webpagina\'s voor 2 uur.','Assets & Web Pages'=>'Activa & webpagina\'s','Cache enabled for assets and pages.'=>'Cache is ingeschakeld voor assets en pagina\'s.','Tuned for sites that change at least weekly.'=>'Afgestemde voor sites die minstens wekelijks veranderen.','Cache static assets for 1 week and web pages for 8 hours.'=>'Cache statische assets voor 1 week en web pagina\'s voor 8 uur.','Assets & Web Pages - Extended'=>'Assets & webpagina\'s - Uitgebreid','Cache enabled for assets and pages (extended).'=>'Cache geactiveerd voor assets en pagina\'s (uitgebreid).','Tuned for sites that update a few times a month or less.'=>'Ingelogd voor sites die een paar keer per maand of minder bijwerken.','Boost speed and performance by storing a copy of your website content, files, and images online so the pages of your website load faster for your visitors.'=>'Boost snelheid en prestaties door een kopie op te slaan van de inhoud van uw website, bestanden, en afbeeldingen online zodat de pagina\'s van uw website sneller laden voor uw bezoekers.','Cache setting saved'=>'Cache-instellingen opgeslagen','Clear All Cache Now'=>'Wis alle cache nu','We automatically clear your cache as you work (creating content, changing settings, installing plugins and more). But you can manually clear it here to be confident it is fresh.'=>'De cache wordt automatisch gewist terwijl je werkt (inhoud, wijzigen van instellingen, installeren van plug-ins en meer). Maar je kunt het hier handmatig verwijderen om er zeker van te zijn dat het vers is.','Cache cleared'=>'Cache gewist','Clear Cache'=>'Cache legen','Exclude from cache'=>'Uitsluiten van cache','This setting controls what pages pass a “no-cache” header so that page caching and browser caching is not used.'=>'Deze instelling bepaalt welke pagina\'s een "no-cache" header geven zodat pagina caching en browser caching niet wordt gebruikt.','Cache Exclusion saved'=>'Cache uitsluiten opgeslagen','Save'=>'Opslaan','Skip 404'=>'404 overslaan','When enabled, static resources like images and fonts will use a default server 404 page and not WordPress 404 pages. Pages and posts will continue using WordPress for 404 pages. This can considerably speed up your website if a static resource like an image or font is missing.'=>'Wanneer ingeschakeld, zullen statische bronnen, zoals afbeeldingen en lettertypen, een standaard server 404 pagina gebruiken en niet WordPress 404 pagina\'s. Pagina\'s en posts zullen blijven gebruiken WordPress voor 404 pagina\'s. Dit kan je website aanzienlijk versnellen als een statische bron zoals een afbeelding of lettertype ontbreekt.','Enable Skip 404 Handling For Static Files'=>'Inschakelen Skip 404 Handling voor Statische Bestanden','Skip 404 saved'=>'Sla 404 opgeslagen op','Image Optimization'=>'Afbeelding optimalisatie','We automatically optimize your uploaded images to WebP format for faster performance and reduced file sizes. You can also choose to delete the original images to save storage space.'=>'We optimaliseren automatisch uw geüploade afbeeldingen naar WebP-formaat voor snellere prestaties en verminderde bestandsgrootte. U kunt ook kiezen om de originele afbeeldingen te verwijderen om ruimte te besparen.','Enable Image Optimization'=>'Optimalisatie afbeelding inschakelen','Enable or disable image optimization globally.'=>'Afbeeldingsoptimalisatie globaal in- of uitschakelen.','Automatically Optimize Uploaded Images'=>'Geüploade afbeeldingen automatisch optimaliseren','When enabled, all your new image uploads will be automatically optimized to WebP format, ensuring faster page loading and reduced file sizes.'=>'Wanneer ingeschakeld, zullen al uw nieuwe afbeeldingsuploads automatisch worden geoptimaliseerd naar WebP-formaat, waardoor de pagina sneller wordt geladen en de bestandsgrootte wordt verkleind.','Auto Delete Original Image'=>'Originele afbeelding automatisch verwijderen','When enabled, the original uploaded image is deleted and replaced with the optimized version, helping to save storage space. If disabled, the optimized image is saved as a separate file, retaining the original.'=>'Wanneer ingeschakeld, wordt de origineel geüploade afbeelding verwijderd en vervangen door de geoptimaliseerde versie, helpt u opslagruimte te besparen. Als dit is uitgeschakeld, wordt de geoptimaliseerde afbeelding opgeslagen als een apart bestand, waardoor het origineel behouden blijft.','No settings available.'=>'Geen instellingen beschikbaar.','Oops! Something went wrong. Please try again.'=>'Oeps! Er is iets fout gegaan. Probeer het opnieuw.','Loading settings…'=>'Instellingen laden…','Settings updated successfully'=>'Instellingen met succes bijgewerkt','Your image optimization settings have been saved.'=>'Uw instellingen voor de optimalisatie van de afbeeldingen zijn opgeslagen.','Enable Lazy Loading'=>'Activeer Lazy Laden','Lazy loading defers the loading of images until they are visible on the screen, improving page load speed and performance.'=>'Lazy laadt het laden van afbeeldingen uit totdat ze zichtbaar zijn op het scherm, waardoor de laadsnelheid en prestaties van pagina\'s worden verbeterd.','Lazy loading has been updated.'=>'Lazy laden is bijgewerkt.','Oops! There was an error updating the lazy loading settings.'=>'Oeps! Er is een fout opgetreden bij het bijwerken van de luie laadinstellingen.','Enable Bulk Optimization of Images'=>'Bulk optimalisatie van afbeeldingen inschakelen','When enabled, allows bulk optimization of images in the media library.'=>'Indien ingeschakeld, staat groepsgewijze optimalisatie van afbeeldingen in de mediabibliotheek toe.','Go to Media Library'=>'Ga naar mediabibliotheek','Error Updating Settings'=>'Fout bij bijwerken instellingen','Prefer Optimized Image When Exists'=>'Geoptimaliseerde afbeelding van voorkeur','When enabled, optimized images will be served in place of original images when they exist, improving performance.'=>'Wanneer ingeschakeld, worden geoptimaliseerde afbeeldingen in plaats van originele afbeeldingen geserveerd wanneer ze bestaan, verbeterde prestaties.','Something went wrong while updating the settings. Please try again.'=>'Er ging iets mis tijdens het bijwerken van de instellingen. Probeer het opnieuw.','Usage:'=>'Gebruik:','images processed of'=>'afbeeldingen verwerkt van','/month'=>'/maand','Asks the browser to download and cache links on the page ahead of them being clicked on, so that when they are clicked they load almost instantly.'=>'Vraagt de browser om links te downloaden en te cachen op de pagina voordat er op wordt geklikt, zodat wanneer op ze wordt geklikt, ze bijna direct laden.','Link prefetching setting saved'=>'Link prefetching instelling opgeslagen','Link Prefetch'=>'Koppeling Prefetch','Enable link prefetching on desktop'=>'Schakel link prefetching in op desktop','Activate on desktop'=>'Activeren op het bureaublad','Behavior of the prefetch'=>'Gedrag van de prefetch','Behavior'=>'Gedrag','Prefetch on Mouse Down'=>'Prefetch op Muis Down','Prefetch on Mouse Down: Starts loading the page as soon as you click down, for faster response when you release the click.'=>'Prefetch op Mouse Down: start met het laden van de pagina zodra je op beneden klikt, voor snellere reactie wanneer je de klik loslaten.','Prefetch on Mouse Hover (Recommended)'=>'Voorkeur op muis Hover (aanbevolen)','Prefetch on Mouse Hover: Begins loading the page the moment your cursor hovers over a link'=>'Prefetch op Muis Hover: Begint de pagi